{"content": "\u9ad8\u5229\u8d37\u53d1\u73b0\u4e00\u4e2a\u5c31\u5224\u91cd\u7f6a\uff01\u770b\u54ea\u4e2a\u8fd8\u6562\uff1f", "text": "\u9ad8\u5229\u8d37\u53d1\u73b0\u4e00\u4e2a\u5c31\u5224\u91cd\u7f6a\uff01\u770b\u54ea\u4e2a\u8fd8\u6562\uff1f", "news_id": "weibo", "id": 225, "timestamp": 42853}
{"content": "\u8fbd\u5b81\u7701\u978d\u5c71\u5e02\u56fd\u5bb6\u5b89\u5168\u5c40\u6bb5\u67d0\uff08\u978d\u5c71\u7b2c\u4e09\u533b\u9662\u9000\u4f11\u836f\u5242\u5e08\u6bb5\u6587\u8fbe\u7684\u513f\u5b50\uff09\uff0c\u4ece\u81f3\u5c112001\u5e74\u5f00\u59cb\u6307\u4f7f\u978d\u5c71\u4e00\u5bb6\u4eba\u5229\u7528\u95f4\u8c0d\u8bbe\u5907\u5728\u6697\u4e2d\u76d1\u63a7\u6211\u7684\u4e00\u4e3e\u4e00\u52a8\uff0c\u5f53\u65f6\u6211\u5df2\u7ecf\u79bb\u5f00\u978d\u5c71\uff0c\u4ed6\u4eec\u4e00\u8def\u8ddf\u8e2a\u4e00\u8def\u76d1\u63a7\u6211\u5230\u6c5f\u6d59\u6caa\uff0c\u5728\u6211\u4e0d\u77e5\u60c5\u7684\u60c5\u51b5\u4e0b\u7834\u574f\u6211\u751f\u6d3b\u4e2d\u7684\u65b9\u65b9\u9762\u9762\u30022016\u5e749\u6708\u4ed6\u4eec\u77e5\u9053\u6211\u8981\u6323\u94b1\u4e86\uff0c\u76d1\u63a7\u6211\u7684\u978d\u5c71\u4e00\u5bb6\u4eba\u4ece\u6697\u4e2d\u75af\u72c2\u8df3\u51fa\u6765\uff0c\u5229\u7528\u5b9a\u5411\u80fd\u8bbe\u5907\u516c\u5f00\u5bf9\u6211\u8fdb\u884c24\u5c0f\u65f6\u7684\u8bed\u97f3\u8f90\u5c04\u5e72\u6270\uff0c\u516c\u5f00\u5ba3\u79f0\u6211\u4eec\u5c31\u662f\u8981\u62d6\u4f4f\u4f60\uff0c\u5c31\u662f\u4e0d\u8ba9\u4f60\u8fc7\u597d\uff0c\u5c31\u662f\u8981\u8ba9\u4f60\u6323\u4e0d\u5230\u94b1\uff01\u76f4\u5230\u4ed6\u4eec\u516c\u5f00\u8df3\u51fa\u6765\u6211\u624d\u77e5\u9053\u81ea\u5df1\u88ab\u4eba\u5728\u6697\u4e2d\u76d1\u63a7\u4e86\u81f3\u5c11\u5341\u4e94\u5e74\u4ee5\u4e0a\uff01\u978d\u5c71400\u591a\u4e07\u4eba\u53e3\u4ec0\u4e48\u6837\u7684\u4eba\u6ca1\u6709\u4ed6\u4eec\u90fd\u4e0d\u6562\u63a7\uff0c\u504f\u504f\u4e00\u8def\u8ddf\u8e2a\u4e00\u8def\u76d1\u63a7\u6211\u8fd9\u4e2a\u65e9\u5c31\u4e0d\u5728\u978d\u5c71\u7684\u4eba\uff0c\u72e0\u6574\u6211\u5341\u4e94\u5e74\u4ee5\u4e0a\u8fd8\u89c9\u5f97\u4e0d\u8fc7\u763e\uff0c\u73b0\u5728\u8fd9\u4e2a\u65f6\u95f4\u8df3\u51fa\u6765\u5c31\u662f\u8981\u7f6e\u6211\u4e8e\u6b7b\u5730\uff0c\u5c31\u662f\u8981\u7edd\u4e86\u6211\uff01\u771f\u662f\u6b3a\u8d1f\u4eba\u6b3a\u8d1f\u5230\u5bb6\u4e86\uff01", "text": "\u8fbd\u5b81\u7701\u978d\u5c71\u5e02\u56fd\u5bb6\u5b89\u5168\u5c40\u6bb5\u67d0\uff08\u978d\u5c71\u7b2c\u4e09\u533b\u9662\u9000\u4f11\u836f\u5242\u5e08\u6bb5\u6587\u8fbe\u7684\u513f\u5b50\uff09\uff0c\u4ece\u81f3\u5c112001\u5e74\u5f00\u59cb\u6307\u4f7f\u978d\u5c71\u4e00\u5bb6\u4eba\u5229\u7528\u95f4\u8c0d\u8bbe\u5907\u5728\u6697\u4e2d\u76d1\u63a7\u6211\u7684\u4e00\u4e3e\u4e00\u52a8\uff0c\u5f53\u65f6\u6211\u5df2\u7ecf\u79bb\u5f00\u978d\u5c71\uff0c\u4ed6\u4eec\u4e00\u8def\u8ddf\u8e2a\u4e00\u8def\u76d1\u63a7\u6211\u5230\u6c5f\u6d59\u6caa\uff0c\u5728\u6211\u4e0d\u77e5\u60c5\u7684\u60c5\u51b5\u4e0b\u7834\u574f\u6211\u751f\u6d3b\u4e2d\u7684\u65b9\u65b9\u9762\u9762\u30022016\u5e749\u6708\u4ed6\u4eec\u77e5\u9053\u6211\u8981\u6323\u94b1\u4e86\uff0c\u76d1\u63a7\u6211\u7684\u978d\u5c71\u4e00\u5bb6\u4eba\u4ece\u6697\u4e2d\u75af\u72c2\u8df3\u51fa\u6765\uff0c\u5229\u7528\u5b9a\u5411\u80fd\u8bbe\u5907\u516c\u5f00\u5bf9\u6211\u8fdb\u884c24\u5c0f\u65f6\u7684\u8bed\u97f3\u8f90\u5c04\u5e72\u6270\uff0c\u516c\u5f00\u5ba3\u79f0\u6211\u4eec\u5c31\u662f\u8981\u62d6\u4f4f\u4f60\uff0c\u5c31\u662f\u4e0d\u8ba9\u4f60\u8fc7\u597d\uff0c\u5c31\u662f\u8981\u8ba9\u4f60\u6323\u4e0d\u5230\u94b1\uff01\u76f4\u5230\u4ed6\u4eec\u516c\u5f00\u8df3\u51fa\u6765\u6211\u624d\u77e5\u9053\u81ea\u5df1\u88ab\u4eba\u5728\u6697\u4e2d\u76d1\u63a7\u4e86\u81f3\u5c11\u5341\u4e94\u5e74\u4ee5\u4e0a\uff01\u978d\u5c71400\u591a\u4e07\u4eba\u53e3\u4ec0\u4e48\u6837\u7684\u4eba\u6ca1\u6709\u4ed6\u4eec\u90fd\u4e0d\u6562\u63a7\uff0c\u504f\u504f\u4e00\u8def\u8ddf\u8e2a\u4e00\u8def\u76d1\u63a7\u6211\u8fd9\u4e2a\u65e9\u5c31\u4e0d\u5728\u978d\u5c71\u7684\u4eba\uff0c\u72e0\u6574\u6211\u5341\u4e94\u5e74\u4ee5\u4e0a\u8fd8\u89c9\u5f97\u4e0d\u8fc7\u763e\uff0c\u73b0\u5728\u8fd9\u4e2a\u65f6\u95f4\u8df3\u51fa\u6765\u5c31\u662f\u8981\u7f6e\u6211\u4e8e\u6b7b\u5730\uff0c\u5c31\u662f\u8981\u7edd\u4e86\u6211\uff01\u771f\u662f\u6b3a\u8d1f\u4eba\u6b3a\u8d1f\u5230\u5bb6\u4e86\uff01", "news_id": "weibo", "id": 226, "timestamp": 42853}
{"content": "\u8fbd\u5b81\u978d\u5c71\u56fd\u5bb6\u5b89\u5168\u5c40\u6bb5\u67d0\uff0c\u4f60\u548c\u76d1\u63a7\u6211\u7684\u978d\u5c71\u6e85\u6bd4\u4e00\u5bb6\u5b50\u6863\u6b21\u592a\u4f4e\u9119\u683c\u592a\u4f4e\uff0c\u4f60\u4eec\u6ca1\u89c1\u8fc7\u4e16\u9762\u6ca1\u89c1\u8fc7\u94b1\uff0c\u89c1\u4e0d\u5f97\u522b\u4eba\u597d\u89c1\u4e0d\u5f97\u522b\u4eba\u6323\u94b1\uff01\u6211\u624d\u77e5\u9053\u539f\u6765\u56fd\u5bb6\u5b89\u5168\u5c40\u7684\u4eba\u5de5\u4f5c\u804c\u8d23\u662f\u7ea2\u773c\u75c5\u89c1\u4e0d\u5f97\u522b\u4eba\u8fc7\u597d\uff0c\u662f\u628a\u4e8b\u505a\u7edd\u4e0d\u8ba9\u666e\u901a\u4eba\u5408\u6cd5\u8d5a\u94b1\u7684\uff01\u6211\u8981\u8ba9\u5168\u56fd\u7f51\u6c11\u77e5\u9053\u56fd\u5b89\u5c40\u8fd8\u6709\u8fd9\u6837\u7684low\u6bd4\uff0c\u4ed6\u4e0d\u53bb\u4fdd\u536b\u56fd\u5bb6\u5b89\u5168\uff0c\u800c\u662f\u5229\u7528\u804c\u52a1\u4e4b\u4fbf\u975e\u6cd5\u76d1\u63a7\u4ed6\u4eba\u591a\u5e74\uff0c\u770b\u5230\u522b\u4eba\u8981\u6323\u94b1\u7ea2\u773c\u775b\u4e86\uff01\u6bb5\u67d0\u4f60\u7684\u6240\u4f5c\u6240\u4e3a\u8ba9\u77e5\u9053\u8fd9\u4ef6\u4e8b\u7684\u4eba\u975e\u5e38\u77a7\u4e0d\u8d77\u3002\u4f60\u4eec\u4e24\u5bb6\u4e0d\u662f\u8981\u7edd\u4e86\u6211\u4e48\uff1f\u4f60\u4eec\u4e24\u5bb6\u7edd\u4e0d\u4e86\u6211\uff0c\u6211\u7edd\u4f60\u4e24\u5bb6\uff01<br>\u6211\u7684\u7b2c\u4e00\u6b21\u6750\u6599\u5df2\u7ecf\u9012\u4ea4\u4e0a\u53bb\u4e86\uff0c\u91cc\u9762\u5199\u7684\u662f\u4ece\u81f3\u5c112011\u5e742012\u5e74\u5f00\u59cb\u88ab\u76d1\u63a7\uff0c\u73b0\u5728\u6211\u53ef\u4ee5\u786e\u5b9a\u81f3\u5c11\u4ece2001\u5e74\u5f00\u59cb\u6211\u5c31\u88ab\u4f60\u6697\u4e2d\u76d1\u63a7\u4e86\uff01\u4e8b\u60c5\u7684\u6027\u8d28\u8981\u6bd4\u539f\u6765\u60f3\u8c61\u7684\u6076\u52a3\u7684\u591a\u7684\u591a\uff01\u6bb5\u67d0\u5c31\u4f60\u8fd9\u6bd4\u6837\u4f60\u4fdd\u536b\u4f60\u5988\u7684\u56fd\u5bb6\u5b89\u5168\uff01\u6211\u4e5f\u4e0d\u60f3\u7ed9\u56fd\u5bb6\u6dfb\u4e71\uff0c\u4f46\u662f\u662f\u4f60\u56fd\u5b89\u5c40\u7684\u4e2a\u522b\u5783\u573e\u5728\u5236\u9020\u5185\u90e8\u6050\u6016\uff01\u6211\u8981\u770b\u770b\u56fd\u5bb6\u5141\u8bb8\u4e0d\u5141\u8bb8\u4f60\u4e00\u4e2a\u4eba\u62c9\u4f4e\u6574\u4e2a\u4e2d\u56fd\u56fd\u5b89\u961f\u4f0d\u7684\u6863\u6b21\u548c\u5f62\u8c61\uff0c\u770b\u770b\u4f60\u4f1a\u662f\u4ec0\u4e48\u4e0b\u573a\u3002\u6bb5\u67d0\u4f60\u5e94\u8be5\u53bb\u6b7b\uff01", "text": "\u8fbd\u5b81\u978d\u5c71\u56fd\u5bb6\u5b89\u5168\u5c40\u6bb5\u67d0\uff0c\u4f60\u548c\u76d1\u63a7\u6211\u7684\u978d\u5c71\u6e85\u6bd4\u4e00\u5bb6\u5b50\u6863\u6b21\u592a\u4f4e\u9119\u683c\u592a\u4f4e\uff0c\u4f60\u4eec\u6ca1\u89c1\u8fc7\u4e16\u9762\u6ca1\u89c1\u8fc7\u94b1\uff0c\u89c1\u4e0d\u5f97\u522b\u4eba\u597d\u89c1\u4e0d\u5f97\u522b\u4eba\u6323\u94b1\uff01\u6211\u624d\u77e5\u9053\u539f\u6765\u56fd\u5bb6\u5b89\u5168\u5c40\u7684\u4eba\u5de5\u4f5c\u804c\u8d23\u662f\u7ea2\u773c\u75c5\u89c1\u4e0d\u5f97\u522b\u4eba\u8fc7\u597d\uff0c\u662f\u628a\u4e8b\u505a\u7edd\u4e0d\u8ba9\u666e\u901a\u4eba\u5408\u6cd5\u8d5a\u94b1\u7684\uff01\u6211\u8981\u8ba9\u5168\u56fd\u7f51\u6c11\u77e5\u9053\u56fd\u5b89\u5c40\u8fd8\u6709\u8fd9\u6837\u7684low\u6bd4\uff0c\u4ed6\u4e0d\u53bb\u4fdd\u536b\u56fd\u5bb6\u5b89\u5168\uff0c\u800c\u662f\u5229\u7528\u804c\u52a1\u4e4b\u4fbf\u975e\u6cd5\u76d1\u63a7\u4ed6\u4eba\u591a\u5e74\uff0c\u770b\u5230\u522b\u4eba\u8981\u6323\u94b1\u7ea2\u773c\u775b\u4e86\uff01\u6bb5\u67d0\u4f60\u7684\u6240\u4f5c\u6240\u4e3a\u8ba9\u77e5\u9053\u8fd9\u4ef6\u4e8b\u7684\u4eba\u975e\u5e38\u77a7\u4e0d\u8d77\u3002\u4f60\u4eec\u4e24\u5bb6\u4e0d\u662f\u8981\u7edd\u4e86\u6211\u4e48\uff1f\u4f60\u4eec\u4e24\u5bb6\u7edd\u4e0d\u4e86\u6211\uff0c\u6211\u7edd\u4f60\u4e24\u5bb6\uff01<br>\u6211\u7684\u7b2c\u4e00\u6b21\u6750\u6599\u5df2\u7ecf\u9012\u4ea4\u4e0a\u53bb\u4e86\uff0c\u91cc\u9762\u5199\u7684\u662f\u4ece\u81f3\u5c112011\u5e742012\u5e74\u5f00\u59cb\u88ab\u76d1\u63a7\uff0c\u73b0\u5728\u6211\u53ef\u4ee5\u786e\u5b9a\u81f3\u5c11\u4ece2001\u5e74\u5f00\u59cb\u6211\u5c31\u88ab\u4f60\u6697\u4e2d\u76d1\u63a7\u4e86\uff01\u4e8b\u60c5\u7684\u6027\u8d28\u8981\u6bd4\u539f\u6765\u60f3\u8c61\u7684\u6076\u52a3\u7684\u591a\u7684\u591a\uff01\u6bb5\u67d0\u5c31\u4f60\u8fd9\u6bd4\u6837\u4f60\u4fdd\u536b\u4f60\u5988\u7684\u56fd\u5bb6\u5b89\u5168\uff01\u6211\u4e5f\u4e0d\u60f3\u7ed9\u56fd\u5bb6\u6dfb\u4e71\uff0c\u4f46\u662f\u662f\u4f60\u56fd\u5b89\u5c40\u7684\u4e2a\u522b\u5783\u573e\u5728\u5236\u9020\u5185\u90e8\u6050\u6016\uff01\u6211\u8981\u770b\u770b\u56fd\u5bb6\u5141\u8bb8\u4e0d\u5141\u8bb8\u4f60\u4e00\u4e2a\u4eba\u62c9\u4f4e\u6574\u4e2a\u4e2d\u56fd\u56fd\u5b89\u961f\u4f0d\u7684\u6863\u6b21\u548c\u5f62\u8c61\uff0c\u770b\u770b\u4f60\u4f1a\u662f\u4ec0\u4e48\u4e0b\u573a\u3002\u6bb5\u67d0\u4f60\u5e94\u8be5\u53bb\u6b7b\uff01", "news_id": "weibo", "id": 227, "timestamp": 42853}
{"content": "\u94f6\u884c\u662f\u5c0f\u989d\u8d37\u7684\u7239", "text": "\u94f6\u884c\u662f\u5c0f\u989d\u8d37\u7684\u7239", "news_id": "weibo", "id": 228, "timestamp": 42853}
{"content": "\u600e\u4e48\u52a0\u5927\uff1f", "text": "\u600e\u4e48\u52a0\u5927\uff1f", "news_id": "weibo", "id": 229, "timestamp": 42853}
{"content": "\u4e0a\u9762\u8bf4\u5230\u5173\u952e\u4e86\uff0c\u62b5\u6297\u4e0d\u4f4f\u8bf1\u60d1\uff0c\u53ef\u662f\u8bf1\u60d1\u5f88\u591a\u554a\u3002", "text": "\u4e0a\u9762\u8bf4\u5230\u5173\u952e\u4e86\uff0c\u62b5\u6297\u4e0d\u4f4f\u8bf1\u60d1\uff0c\u53ef\u662f\u8bf1\u60d1\u5f88\u591a\u554a\u3002", "news_id": "weibo", "id": 230, "timestamp": 42853}
{"content": "\u670b\u53cb\u95ee\u6211\uff0c\u4e3a\u4ec0\u4e48\u4e2d\u4e1c\u7684\u7f8e\u5973\u4e2a\u4e2a\u90fd\u8c8c\u7f8e\u5982\u82b1\uff0c\u5374\u8981\u5e26\u9762\u7eb1\uff1f\u6211\u556a\u5c31\u662f\u4e00\u5df4\u638c\uff0c\u8fd9\u7279\u4e48\u4e0d\u662f\u5e9f\u8bdd\u5417\uff0c\u8fd9\u91cc\u70b9\u8d5e\u7684\u5144\u5f1f\u54ea\u4e2a\u4e01\u4e01\u4e0d\u662f\u96c4\u58ee\u5a01\u6b66\uff0c\u4e0d\u7167\u6837\u7a7f\u7740\u5185\u88e4\u5417", "text": "\u670b\u53cb\u95ee\u6211\uff0c\u4e3a\u4ec0\u4e48\u4e2d\u4e1c\u7684\u7f8e\u5973\u4e2a\u4e2a\u90fd\u8c8c\u7f8e\u5982\u82b1\uff0c\u5374\u8981\u5e26\u9762\u7eb1\uff1f\u6211\u556a\u5c31\u662f\u4e00\u5df4\u638c\uff0c\u8fd9\u7279\u4e48\u4e0d\u662f\u5e9f\u8bdd\u5417\uff0c\u8fd9\u91cc\u70b9\u8d5e\u7684\u5144\u5f1f\u54ea\u4e2a\u4e01\u4e01\u4e0d\u662f\u96c4\u58ee\u5a01\u6b66\uff0c\u4e0d\u7167\u6837\u7a7f\u7740\u5185\u88e4\u5417", "news_id": "weibo", "id": 231, "timestamp": 42853}
