{"content": "\u9ad8\u5229\u8d37\u548c\u5176\u884d\u751f\u54c1\u8ba8\u503a\u4eba\u5df2\u7ecf\u6210\u4e3a\u5371\u5bb3\u793e\u4f1a\u7a33\u5b9a\u7684\u6bd2\u7624\u4e86\uff0c\u4e3a\u4ec0\u4e48\u4e0d\u80fd\u50cf\u6253\u51fb\u9ec4\u8d4c\u6bd2\u90a3\u6837\u53d6\u7f14\u6389\uff1f\u591a\u5c11\u56e0\u4e3a\u8fd9\u4e2a\u5bb6\u7834\u4eba\u4ea1\u4e86\uff01\uff01\uff01\uff01", "text": "\u9ad8\u5229\u8d37\u548c\u5176\u884d\u751f\u54c1\u8ba8\u503a\u4eba\u5df2\u7ecf\u6210\u4e3a\u5371\u5bb3\u793e\u4f1a\u7a33\u5b9a\u7684\u6bd2\u7624\u4e86\uff0c\u4e3a\u4ec0\u4e48\u4e0d\u80fd\u50cf\u6253\u51fb\u9ec4\u8d4c\u6bd2\u90a3\u6837\u53d6\u7f14\u6389\uff1f\u591a\u5c11\u56e0\u4e3a\u8fd9\u4e2a\u5bb6\u7834\u4eba\u4ea1\u4e86\uff01\uff01\uff01\uff01", "news_id": "weibo", "id": 370, "timestamp": 42853}
{"content": "\u73b0\u5728\u7edd\u5927\u591a\u6570\u6240\u8c13\u8d37\u6b3e\u90fd\u5f02\u5316\u4e86\uff1a<br>1\u3001\u5229\u606f\u9ad8\uff0c1\u5206\u4e001\u52065\u662f\u5c11\u6570\uff0c\u591a\u65701\u52065\u751a\u81f32\u5206\u4ee5\u4e0a\uff0c\u9700\u77e5GDP\u4e00\u5e74\u4e0d\u52308\uff05\uff0c\u8fd8\u662f\u9ad8\u4f01\u7684\u623f\u4ef7\u5e73\u5747\u7684\uff01\u4e0d\u5c11\u4f01\u4e1a\u4e8f\u635f\u6216\u5fae\u5229\uff08\u8fbe\u4e0d\u5230GDP\u5e73\u5747\u503c\uff09<br>2\u3001\u671f\u9650\u77ed\uff0c\u501f\u4e00\u6708\u4e09\u6708\u534a\u5e74\u4e3a\u591a\uff0c\u4e00\u5e74\u81f3\u4e09\u5e74\u4e5f\u4e0d\u5c11\u3002\u4f46\u662f\u636e\u4e86\u89e3\u8fd4\u6b3e\u90fd\u5341\u5206\u5947\u8469\u548c\u82db\u523b\uff0c\u6bcf\u6708\u90fd\u8981\u8fd8\u672c\u53ca\u5229\u606f\uff0c\u8fd9\u8ba9\u521b\u4e1a\u8005\u6216\u501f\u8d37\u8005\u5904\u4e8e\u76f8\u5f53\u4e0d\u5229\u7684\u5883\u5730\u3002\u7ecf\u8425\u5c1a\u672a\u6253\u5f00\u5c40\u9762\uff0c\u672c\u91d1\u5df2\u5f00\u59cb\u5206\u6279\u5feb\u901f\u62bd\u8d70\uff0c\u7ecf\u8425\u8005\u6216\u501f\u8d37\u8005\u538b\u529b\u5de8\u5927\uff0c\u8bb8\u591a\u672c\u53ef\u4ee5\u505a\u597d\u7684\u4e8b\u60c5\u90fd\u88ab\u6025\u529f\u8fd1\u5229\u7684\u9ad8\u5229\u8d37\u641e\u6b8b\u641e\u574f\u4e86\u3002<br>3\u3001\u94f6\u884c\u76f8\u5bf9\u4f4e\u606f\u4e2d\u957f\u671f\u8d37\u6b3e\u5bf9\u521b\u4e1a\u3001\u4f01\u4e1a\u7ecf\u8425\u4ee5\u53ca\u4e2a\u4eba\u505a\u4e8b\u6bd4\u8f83\u6709\u610f\u4e49\uff0c\u4f46\u96be\u8d37\u6216\u8005\u94f6\u884c\u5e72\u8106\u8054\u624b\u5916\u9762\u5e73\u53f0\u641e\u9ad8\u606f\u521b\u6536\uff0c\u94b1\u7167\u6837\u6323\u98ce\u9669\u8f6c\u5ac1\u3002<br><br>\u9ad8\u606f\u7684\u8d27\u6b3e\u4e0d\u8bba\u77ed\u957f\u671f\u90fd\u662f\u5783\u573e\u548c\u72d7\u5c4e\u3002\u6b63\u5e38\u5229\u606f\uff085\u5398\u4ee5\u5185\uff09\u7684\u77ed\u4e2d\u957f\u671f\u8d37\u6b3e\u5bf9\u7ecf\u6d4e\u53d1\u5c55\u624d\u6709\u610f\u4e49\u3002", "text": "\u73b0\u5728\u7edd\u5927\u591a\u6570\u6240\u8c13\u8d37\u6b3e\u90fd\u5f02\u5316\u4e86\uff1a<br>1\u3001\u5229\u606f\u9ad8\uff0c1\u5206\u4e001\u52065\u662f\u5c11\u6570\uff0c\u591a\u65701\u52065\u751a\u81f32\u5206\u4ee5\u4e0a\uff0c\u9700\u77e5GDP\u4e00\u5e74\u4e0d\u52308\uff05\uff0c\u8fd8\u662f\u9ad8\u4f01\u7684\u623f\u4ef7\u5e73\u5747\u7684\uff01\u4e0d\u5c11\u4f01\u4e1a\u4e8f\u635f\u6216\u5fae\u5229\uff08\u8fbe\u4e0d\u5230GDP\u5e73\u5747\u503c\uff09<br>2\u3001\u671f\u9650\u77ed\uff0c\u501f\u4e00\u6708\u4e09\u6708\u534a\u5e74\u4e3a\u591a\uff0c\u4e00\u5e74\u81f3\u4e09\u5e74\u4e5f\u4e0d\u5c11\u3002\u4f46\u662f\u636e\u4e86\u89e3\u8fd4\u6b3e\u90fd\u5341\u5206\u5947\u8469\u548c\u82db\u523b\uff0c\u6bcf\u6708\u90fd\u8981\u8fd8\u672c\u53ca\u5229\u606f\uff0c\u8fd9\u8ba9\u521b\u4e1a\u8005\u6216\u501f\u8d37\u8005\u5904\u4e8e\u76f8\u5f53\u4e0d\u5229\u7684\u5883\u5730\u3002\u7ecf\u8425\u5c1a\u672a\u6253\u5f00\u5c40\u9762\uff0c\u672c\u91d1\u5df2\u5f00\u59cb\u5206\u6279\u5feb\u901f\u62bd\u8d70\uff0c\u7ecf\u8425\u8005\u6216\u501f\u8d37\u8005\u538b\u529b\u5de8\u5927\uff0c\u8bb8\u591a\u672c\u53ef\u4ee5\u505a\u597d\u7684\u4e8b\u60c5\u90fd\u88ab\u6025\u529f\u8fd1\u5229\u7684\u9ad8\u5229\u8d37\u641e\u6b8b\u641e\u574f\u4e86\u3002<br>3\u3001\u94f6\u884c\u76f8\u5bf9\u4f4e\u606f\u4e2d\u957f\u671f\u8d37\u6b3e\u5bf9\u521b\u4e1a\u3001\u4f01\u4e1a\u7ecf\u8425\u4ee5\u53ca\u4e2a\u4eba\u505a\u4e8b\u6bd4\u8f83\u6709\u610f\u4e49\uff0c\u4f46\u96be\u8d37\u6216\u8005\u94f6\u884c\u5e72\u8106\u8054\u624b\u5916\u9762\u5e73\u53f0\u641e\u9ad8\u606f\u521b\u6536\uff0c\u94b1\u7167\u6837\u6323\u98ce\u9669\u8f6c\u5ac1\u3002<br><br>\u9ad8\u606f\u7684\u8d27\u6b3e\u4e0d\u8bba\u77ed\u957f\u671f\u90fd\u662f\u5783\u573e\u548c\u72d7\u5c4e\u3002\u6b63\u5e38\u5229\u606f\uff085\u5398\u4ee5\u5185\uff09\u7684\u77ed\u4e2d\u957f\u671f\u8d37\u6b3e\u5bf9\u7ecf\u6d4e\u53d1\u5c55\u624d\u6709\u610f\u4e49\u3002", "news_id": "weibo", "id": 371, "timestamp": 42853}
