{"content": "\u5b87\u5b99\u7684\u63a2\u7d22\u662f\u79bb\u4e0d\u5f00\u6211\u7684\u8bdd\u7684\uff0c\u53ea\u6709\u628a\u56f4\u7ed5\u5730\u7403\u516c\u8f6c\u7684\u4e00\u5207\u7269\u8d28\u5305\u62ec\u6c14\u4f53\u8ba1\u7b97\u5728\u5730\u7403\u4f53\u79ef\u4e4b\u5185\u624d\u80fd\u627e\u5230\u5730\u7403\u771f\u6b63\u7684\u8fb9\u548c\u89d2\uff0c\u90a3\u662f\u53cd\u5f15\u529b\u6c47\u805a\u5730\uff0c\u662f\u771f\u6b63\u7684\u771f\u7a7a\u96a7\u9053\uff0c\u5b87\u5b99\u9ad8\u901f\u8def\uff0c\u592a\u9633\u7cfb\u5185\u7684\u52a8\u8109!\u628a\u56f4\u7ed5\u592a\u9633\u516c\u8f6c\u7684\u4e00\u5207\u7269\u8d28\u5305\u62ec\u6c14\u4f53\u8ba1\u7b97\u5728\u592a\u9633\u4f53\u79ef\u4e4b\u5185\u624d\u80fd\u627e\u5230\u6052\u661f\u4e0e\u6052\u661f\u7684\u8fb9\u548c\u89d2\uff0c\u90a3\u662f\u6052\u661f\u4e0e\u6052\u661f\u4e4b\u95f4\u7684\u771f\u7a7a\u9ad8\u901f\u96a7\u9053\uff0c\u627e\u5230\u771f\u7a7a\u96a7\u9053\u4ee5\u8fd1\u5149\u901f\u8d85\u5149\u901f\u98de\u884c\u90a3\u4e0d\u662f\u4e2a\u4e8b!\u5b87\u5b99\u98de\u884c\u5668\u4e5f\u4e0d\u80fd\u6309\u7167\u98de\u673a\u7684\u4e8c\u7ef4\u7ed3\u6784\u539f\u7406\u5236\u9020\uff0c\u98de\u673a\u662f\u4e0d\u80fd\u9ad8\u901f\u81ea\u8f6c\u7684\uff0c\u4f46\u53ea\u6709\u9ad8\u901f\u81ea\u8f6c\u624d\u80fd\u4ea7\u751f\u771f\u7a7a\u7535\u78c1\u573a\uff0c\u4ee5\u8fd1\u5149\u901f\u98de\u884c\uff0c\u672a\u6765\u7684\u5b87\u5b99\u98de\u884c\u5668\u5fc5\u987b\u6309\u5730\u7403\u539f\u7406\u5236\u9020\uff0c\u516b\u5c42\u4ee5\u4e0a\u7ed3\u6784\uff0c\u4f60\u770b\u5730\u7403\u9ad8\u901f\u81ea\u8f6c\u7740\u524d\u8fdb\uff0c\u6211\u4eec\u4eba\u5750\u5728\u5730\u7403\u4e0a\u6709\u5565\u4e0d\u9002\u611f\u89c9\u5417\uff1f\u963f\u95e8", "text": "\u5b87\u5b99\u7684\u63a2\u7d22\u662f\u79bb\u4e0d\u5f00\u6211\u7684\u8bdd\u7684\uff0c\u53ea\u6709\u628a\u56f4\u7ed5\u5730\u7403\u516c\u8f6c\u7684\u4e00\u5207\u7269\u8d28\u5305\u62ec\u6c14\u4f53\u8ba1\u7b97\u5728\u5730\u7403\u4f53\u79ef\u4e4b\u5185\u624d\u80fd\u627e\u5230\u5730\u7403\u771f\u6b63\u7684\u8fb9\u548c\u89d2\uff0c\u90a3\u662