{"content": "\u8001\u54e5\uff0c\u4f55\u4e3a\u4fe1\u7528\u8d37\u6b3e\uff1f\u5c31\u662f\u6211\u4ee5\u6211\u7684\u4e2a\u4eba\u4fe1\u7528\u4f5c\u4e3a\u62b5\u62bc\uff0c\u800c\u4f60\u6839\u636e\u6211\u7684\u62b5\u62bc\u7269\uff08\u4fe1\u7528\uff09\u4f5c\u51fa\u4e00\u4e2a\u4f30\u4ef7\uff0c\u7136\u540e\u4ee5\u6b64\u4e3a\u51c6\u501f\u94b1\u7ed9\u6211\uff0c\u90a3\u4e48\u5f53\u4f60\u7206\u6211\u901a\u8baf\u5f55\u6bc1\u6389\u6211\u7684\u4fe1\u7528\u7684\u65f6\u5019\u5c31\u53ef\u89c6\u4e3a\u5c06\u6211\u5728\u4f60\u90a3\u91cc\u7684\u62b5\u62bc\u7269\uff08\u4fe1\u7528\uff09\u635f\u6bc1\u4e86\uff0c\u8bf7\u95ee\u8fd9\u65f6\u5019\u4e0d\u662f\u5e94\u8be5\u503a\u7269\u76f8\u62b5\u4e24\u6e05\u4e86\u5417\uff1f\u6211\u4e3a\u4ec0\u4e48\u8fd8\u8981\u8fd8\u94b1\uff1f\u8fd8\u6709\u6ca1\u6709\u738b\u6cd5\uff1f", "text": "\u8001\u54e5\uff0c\u4f55\u4e3a\u4fe1\u7528\u8d37\u6b3e\uff1f\u5c31\u662f\u6211\u4ee5\u6211\u7684\u4e2a\u4eba\u4fe1\u7528\u4f5c\u4e3a\u62b5\u62bc\uff0c\u800c\u4f60\u6839\u636e\u6211\u7684\u62b5\u62bc\u7269\uff08\u4fe1\u7528\uff09\u4f5c\u51fa\u4e00\u4e2a\u4f30\u4ef7\uff0c\u7136\u540e\u4ee5\u6b64\u4e3a\u51c6\u501f\u94b1\u7ed9\u6211\uff0c\u90a3\u4e48\u5f53\u4f60\u7206\u6211\u901a\u8baf\u5f55\u6bc1\u6389\u6211\u7684\u4fe1\u7528\u7684\u65f6\u5019\u5c31\u53ef\u89c6\u4e3a\u5c06\u6211\u5728\u4f60\u90a3\u91cc\u7684\u62b5\u62bc\u7269\uff08\u4fe1\u7528\uff09\u635f\u6bc1\u4e86\uff0c\u8bf7\u95ee\u8fd9\u65f6\u5019\u4e0d\u662f\u5e94\u8be5\u503a\u7269\u76f8\u62b5\u4e24\u6e05\u4e86\u5417\uff1f\u6211\u4e3a\u4ec0\u4e48\u8fd8\u8981\u8fd8\u94b1\uff1f\u8fd8\u6709\u6ca1\u6709\u738b\u6cd5\uff1f", "news_id": "weibo", "id": 435, "timestamp": 42853}
